window.bookSummaryJSON = "<p><b>Saved from the streets as a child, Elora spent her adolescent years in the care of seven vampires.</b></p> <p>As time goes by and she enters adulthood, emotions evolve into something unexpected. Pure love turns into burning lust, friendships are challenged, humanity is put to the ultimate test, and loyalty is earned.</p> <p>Filled with passion and desire, this coming-of-age novel follows the story of a selfless human with soiled innocence and the vampires who will do anything to keep her safe.</p> <p>Elora <i>marks the first published work from Beanie Harper about fantasy, lust, and forbidden love. With hints of humor, adventure, and swoon-worthy men, </i>Elora <i>is a novel for those who like plot with their smut.</i></p>"; 
